import React from 'react';

import appState from '../appState.js'

import './nav.css';

class NavContainer extends React.Component {
    constructor(props) {
        this.state = {
            decrementNoteValue : appState.state.decrementNoteValue,
            noteValue : appState.state.noteValue,
            incrementNoteValue : appState.state.incrementNoteValue
        }
    }
    render() {
        return React.createElement(
            'div',
            { className: "nav_container" },
            <NavButton id="dec" handleClick={ appState.state.decrementNoteValue } direction="<"/>,
            <NavNumber key="note_value" noteValue={ appState.state.noteValue }/>,
            <NavButton id="inc" handleClick={ appState.state.incrementNoteValue } direction=">"/>
        );
    }
}

class NavNumber extends React.Component {
    render() {
        return React.createElement(
            "div",
            { className: "nav_number" },
            this.props.noteValue
        );
    }
}

class NavButton extends React.Component {
    render() {
        return React.createElement(
            'button', {
                className: "nav_button",
                id: this.props.id,
                onClick: this.props.handleClick
            }, this.props.direction
        );
    }
}

export default NavContainer;
